import React from "react";
import "./Newsletter.css";
const Newsletter = () => {
  return (
    <div className="newsContainer">
      <h1 id="newsTitle">Subscirbe To Our Newletter</h1>
      <h3 id="newsSubTitle">
        And keep updated for future developments and discounts.
      </h3>
      <div className="inputContainer">
        <input type="email" placeholder="example@google.com"></input>
        <input
          type="submit"
          onClick={() =>
            alert("Yep..just a place holder, no mail spamming here.")
          }
          placeholder="Sign-Up!"
        ></input>
      </div>
    </div>
  );
};
export default Newsletter;
